    <br><br>
    <div class=\"table-responsive\">
    <table class=\"table\">
        <thead>
            <tr>
                <th>Id</th>
                <th>Email</th>
                <th>Roles</th>
                <th>Password</th>
                <th>actions</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.email }}</td>
                <td>{{ user.roles ? user.roles|json_encode : '' }}</td>
                <td>{{ user.password }}</td>
                <td>
                    <a href=\"{{ path('user_show', {'id': user.id}) }}\" class=\"btn btn-outline-primary\">Afficher</a>
                    <a href=\"{{ path('user_edit', {'id': user.id}) }}\" class=\"btn btn-outline-primary\">Modifier</a>
                </td>
            </tr>
        {% else %}
            <tr>
                <td colspan=\"5\">no records found</td>
            </tr>
        {% endfor %}
        </tbody>
    </table>
    </div>
    <br>

    <a href=\"{{ path('user_new') }}\">Create new</a>
{% endblock %}
